import React from 'react';
import {
  Container,
  TextTitle
} from './style.js';
import map from '../../assets/mapworld.png';

function LandingPage() {
  return (
    <Container>
      <div>
        <TextTitle>
          <span className="textshadow">Reach Us</span>
          <div/>
        </TextTitle>
      </div>
      <div>
        <span>Tell us your problem by contacting us</span>
      </div>
      <div>
        <img src={map} alt="map"/>
      </div>
    </Container>
  );
}

export default LandingPage;
